import React, { useEffect, useState } from 'react'

export function HomePage({}) {
    const [backendData, setBackendData] = useState([{}])

    useEffect (() => {
      fetch("/user/all").then(
        response => response.json()
      ).then(
        data => {
          setBackendData(data)
        }
      )
    }, [])

    const getBusRoutes = () => {
      fetch("/bus-routes/all").then(
        response => response.json()
      ).then(
        data => {
          setBackendData(data)
        }
      )
    }

    return(
      <div>
      <button onClick={() => getBusRoutes()}>
          Get Bus Routes
      </button>
      {backendData.map((data) => 
          <div>
          {data.name}
          </div>
      )}
      </div>
    )
}
